(2, 'Impact IT Sp z o.o.', 'Witamy na kanale YouTube firmy Impact IT. Założyliśmy ten kanał z myślą o wszystkich tych, którzy szukają kursów z zakresu technologii których używamy takich ...', 'https://yt3.ggpht.com/-CrjIydI6caM/AAAAAAAAAAI/AAAAAAAAAAA/slNkjTDm_a8/s88-c-k-no-mo-rj-c0xffffff/photo.jpg', '2018-05-30 00:30:14', '2018-05-30 00:30:55'),
(3, 'SPInkafilmstudio', 'BLOK EKIPA, KOŃ RAFAŁ, ADWERSARZE i BIRD BRAIN. Tylko na kanale SPInka Film Studio masz szansę sprawdzić swoje poczucie humoru. Subskrybujcie ...', 'https://yt3.ggpht.com/-k3uWnxXm9Zw/AAAAAAAAAAI/AAAAAAAAAAA/ng6QiLXkD-s/s88-c-k-no-mo-rj-c0xffffff/photo.jpg', '2018-05-30 00:33:20', '2018-05-30 00:35:38'),
(4, 'Rafał Pacześ', 'Jedyny oficjalny kanał Rafała Paczesia.', 'https://yt3.ggpht.com/-XFMEwrQvuJI/AAAAAAAAAAI/AAAAAAAAAAA/Cdoh0m8ktoM/s88-c-k-no-mo-rj-c0xffffff/photo.jpg', '2018-05-30 00:33:46', '2018-05-30 00:35:47'),
(5, 'KręciołaTV', 'http://kreciola.tv/ Videoblog Jurka Owsiaka, muza z Przystanków Woodstock, wywiady z artystami, promocja młodych zespołów i programy LIVE!', 'https://yt3.ggpht.com/-LG6ihQq-OI8/AAAAAAAAAAI/AAAAAAAAAAA/zGML2qfXKnc/s88-c-k-no-mo-rj-c0xffffff/photo.jpg', '2018-05-30 00:34:11', '2018-05-30 00:35:51'),
(6, 'thekooksofficial', 'Pre-order our new album, Let\'s Go Sunshine, at https://thekooks.lnk.to/letsgosunshine!', 'https://yt3.ggpht.com/-njJAsHNvInk/AAAAAAAAAAI/AAAAAAAAAAA/o1MCWZkZoX8/s88-c-k-no-mo-rj-c0xffffff/photo.jpg', '2018-05-30 00:35:03', '2018-05-30 00:36:01');
