(86, 5, 'Shaka Ponk - Morir Cantando #Woodstock2015', 'https://www.youtube.com/embed/fUL6sDRP4_8', 'https://i.ytimg.com/vi/fUL6sDRP4_8/default.jpg', NULL, 'Shaka Ponk to kapela łączącą w swojej muzyce elementy ciężkiego rocka, industrialu, hip-hopu i funky. Do tego muzycy przyjechali z inscenizacją jakiej nie ...', 'Shaka Ponk to kapela łączącą w swojej muzyce elementy ciężkiego rocka, industrialu, hip-hopu i funky. Do tego muzycy przyjechali z inscenizacją jakiej nie było Przystanku Woodstock chyba nigdy. W efekcie występ świetnie wyglądał i wspaniale wybrzmiał. Z resztą sprawdźcie sami!  \n\nKręcioła.Tv łapcie nas tu:\nFacebook - https://www.facebook.com/kreciola\nInstagram - http://instagram.com/kreciolatv\nTwitter - https://twitter.com/kreciolatv\nSnapchat - @kreciolatv', '2018-05-30 00:35:52', '2018-05-30 00:35:52'),
(87, 5, 'Organek - retransmisja koncertu!  #Woodstock2015', 'https://www.youtube.com/embed/Ph4nNml9GwU', 'https://i.ytimg.com/vi/Ph4nNml9GwU/default.jpg', NULL, 'ØRGANEK na Dużą Scenę trafił dzięki Eliminacjom do Przystanku Woodstock. To klasyczne w brzmieniu, nowatorskie w formie vintage, rockowe power trio ...', 'ØRGANEK na Dużą Scenę trafił dzięki Eliminacjom do Przystanku Woodstock. To klasyczne w brzmieniu, nowatorskie w formie vintage, rockowe power trio wspomagane organami Vox\'a. Wyraziste, błyskotliwie opisujące teraźniejszość teksty osadzone w pełnej cytatów i historycznych odniesień muzyce, a także niezwykła ekspresja sceniczna stanowią o wartości zespołu powołanego do życia w 2013 roku przez jego lidera, autora tekstów i kompozycji, gitarzystę i wokalistę - Tomasza Organka.\n\nPodczas koncertu na pewno nie zabraknie największych przebojów Organka, takich jak: „Głupi ja”, „O, matko”, \"Kate Moss\" - zapraszamy na retransmisję koncertu! \n\nSubskrybuj nasz kanał ➡ http://bit.ly/1w8ZNXX\n\nKręcioła.Tv łapcie nas tu:\nFacebook - https://www.facebook.com/kreciola\nInstagram - http://instagram.com/kreciolatv\nTwitter - https://twitter.com/kreciolatv\nSnapchat - @kreciolatv', '2018-05-30 00:35:53', '2018-05-30 00:35:53'),
(88, 5, 'Akurat - Dyskoteka gra', 'https://www.youtube.com/embed/EPjCRPWw2JE', 'https://i.ytimg.com/vi/EPjCRPWw2JE/default.jpg', NULL, 'Wracamy do słonecznych Żar i VII Przystanku Woodstock - zachęcamy do pobujania się radośnie razem z zespołem Akurat. Ktoś z Was pamięta ten koncert?', 'Wracamy do słonecznych Żar i VII Przystanku Woodstock - zachęcamy do pobujania się radośnie razem z zespołem Akurat. Ktoś z Was pamięta ten koncert? \n\nKręcioła.Tv łapcie nas tu:\nFacebook - https://www.facebook.com/kreciola\nInstagram - http://instagram.com/kreciolatv\nTwitter - https://twitter.com/kreciolatv\nSnapchat - @kreciolatv', '2018-05-30 00:35:53', '2018-05-30 00:35:53'),
(89, 5, '#43 Kręciołowa Dziesiątka', 'https://www.youtube.com/embed/qN_v8F3MeBo', 'https://i.ytimg.com/vi/qN_v8F3MeBo/default.jpg', NULL, 'Wy proponujecie woodstockowe numery, a my puszczamy je na żywo! #43 Kręciołowa Dziesiątka a w niej: Akurat - Dyskoteka gra Nine Circle - Games People ...', 'Wy proponujecie woodstockowe numery, a my puszczamy je na żywo! #43 Kręciołowa Dziesiątka a w niej:\nAkurat - Dyskoteka gra\nNine Circle - Games People Play\nJelonek - Mana Mana\nKSU - Na krawędzi snu\nLao Che - Zombi\nMy Riot - Sen\nOlej - Skinowski\nPogodno - Jak Ty się czujesz\nSjhaka Ponk - Morir Cantando\nthe Bill - Piposenka dla żołnierza\n\nKręcioła.Tv łapcie nas tu:\nFacebook - https://www.facebook.com/kreciola\nInstagram - http://instagram.com/kreciolatv\nTwitter - https://twitter.com/kreciolatv\nSnapchat - @kreciolatv', '2018-05-30 00:35:53', '2018-05-30 00:35:53'),
(90, 5, 'Retransmisja ASP - prof. Zbigniew Lew - Starowicz #Woodstock2013', 'https://www.youtube.com/embed/oOZfVpqL8_A', 'https://i.ytimg.com/vi/oOZfVpqL8_A/default.jpg', NULL, 'Zapraszamy do obejrzenia spotkania z prof. Zbigniewem Lwem - Starowiczem, które można nazwać: \"wszystko, co chcecie wiedzieć o seksie, ale boicie się ...', 'Zapraszamy do obejrzenia spotkania z prof. Zbigniewem Lwem - Starowiczem, które można nazwać: \"wszystko, co chcecie wiedzieć o seksie, ale boicie się zapytać\". \n\nRetransmisja wystartuje we wtorek (22.05) o godz. 16:00. \n\nSubskrybuj nasz kanał ➡ http://bit.ly/1w8ZNXX\n\nKręcioła.Tv łapcie nas tu:\nFacebook - https://www.facebook.com/kreciola\nInstagram - http://instagram.com/kreciolatv\nTwitter - https://twitter.com/kreciolatv\nSnapchat - @kreciolatv', '2018-05-30 00:35:54', '2018-05-30 00:35:54'),
(91, 5, 'Za nami poznański półfinał Eliminacji 24. Pol\'and\'Rock Festivalu!', 'https://www.youtube.com/embed/zxtdx9-OKgY', 'https://i.ytimg.com/vi/zxtdx9-OKgY/default.jpg', NULL, 'Znamy kolejnych finalistów Eliminacji! Decyzją jurorów Two Timer - otrzymał zaproszenie na Scenę Lecha, Łydka Grubasa - otrzymali zaproszenie na Małą ...', 'Znamy kolejnych finalistów Eliminacji! Decyzją jurorów Two Timer - otrzymał zaproszenie na Scenę Lecha, Łydka Grubasa - otrzymali zaproszenie na Małą Scenę, Opus Magnum, Neuoberschlesien i OHO!KOKO - przechodzą do Finału Eliminacji i 30 czerwca w Warszawie powalczą o zaproszenie na sceny Najpiękniejszego Festiwalu Świata. \n\nJak było na drugim Półfinale Eliminacji do 24. Pol\'and\'Rock? Sami zobaczcie!\n\n\nSubskrybuj nasz kanał ➡ http://bit.ly/1w8ZNXX\n\nKręcioła.Tv łapcie nas tu:\nFacebook - https://www.facebook.com/kreciola\nInstagram - http://instagram.com/kreciolatv\nTwitter - https://twitter.com/kreciolatv\nSnapchat - @kreciolatv', '2018-05-30 00:35:54', '2018-05-30 00:35:54'),
(92, 5, 'Retransmisja koncertu Sweet Noise z Woodstock 2001', 'https://www.youtube.com/embed/MUQOb50lIDk', 'https://i.ytimg.com/vi/MUQOb50lIDk/default.jpg', NULL, 'Zaglądamy do naszego muzycznego archiwum by wspólnie posłuchać koncertu Sweet Noise Band, który odbył się na Przystanku Woodstock w 2001 roku!', 'Zaglądamy do naszego muzycznego archiwum by wspólnie posłuchać koncertu Sweet Noise Band, który odbył się na Przystanku Woodstock w 2001 roku!\n\nKoncert w całości puścimy na naszym YouTube w czwartek (17.05) o godz. 18:00.\n\n\nSubskrybuj nasz kanał ➡ http://bit.ly/1w8ZNXX\n\nKręcioła.Tv łapcie nas tu:\nFacebook - https://www.facebook.com/kreciola\nInstagram - http://instagram.com/kreciolatv\nTwitter - https://twitter.com/kreciolatv\nSnapchat - @kreciolatv', '2018-05-30 00:35:54', '2018-05-30 00:35:54'),
(93, 5, '#42 Kręciołowa Dziesiątka', 'https://www.youtube.com/embed/9yxHLYKk5Eg', 'https://i.ytimg.com/vi/9yxHLYKk5Eg/default.jpg', NULL, 'Oto ona - #42 Kręciołowa Dziesiątka! Jakich piosenek słucha się najlepiej, kiedy za oknem pogoda barowa? Wasze propozycje: Budka Suflera - Jest taki ...', 'Oto ona - #42 Kręciołowa Dziesiątka! Jakich piosenek słucha się najlepiej, kiedy za oknem pogoda barowa? Wasze propozycje: \n\nBudka Suflera - Jest taki samotny dom\nCarrantuohill - Silver\nComa - Skaczemy\nDamian Marley - Could you be love\nDomowe Melodie - Techno\nJuliette Lewis - Devil knows\nKuba Płucisz - Nie uciekaj\nPiersi - Żośka\nRaz Dwa Trzy - Jutro możemy być szczęśliwi\nShaggy - Boombastic\n\nKręcioła.Tv łapcie nas tu:\nFacebook - https://www.facebook.com/kreciola\nInstagram - http://instagram.com/kreciolatv\nTwitter - https://twitter.com/kreciolatv\nSnapchat - @kreciolatv', '2018-05-30 00:35:55', '2018-05-30 00:35:55'),
(94, 5, 'Retransmiaja spotkania na ASP z Andrzejem Wajdą', 'https://www.youtube.com/embed/sMcSLb2nywA', 'https://i.ytimg.com/vi/sMcSLb2nywA/default.jpg', NULL, '\"Andrzeja Wajdę oraz jego przeuroczą i bardzo ciepłą małżonkę – Krystynę Zachwatowicz ściągnęliśmy na Festiwal przy okazji kręcenia przez niego filmu ...', '\"Andrzeja Wajdę oraz jego przeuroczą i bardzo ciepłą małżonkę – Krystynę Zachwatowicz ściągnęliśmy na Festiwal przy okazji kręcenia przez niego filmu „Katyń”. Film już był nakręcony, montowany i namawialiśmy Pana Andrzeja, aby kawałek był pokazany Woodstockowiczom. Filmu w końcu nie pokazaliśmy, ale za to rozmowa potoczyła się o całej, ogromnej twórczości Pana Andrzeja, o nim samym, o tym wszystkim, co wie każdy, i o tym co mogliśmy usłyszeć po raz pierwszy.\" \n\nJurek Owsiak\n\nZapraszamy do znalezienia chwili i wysłuchania całej rozmowy z Andrzejem Wajdą, które odbyło się na Przystanku Woodstock w 2010 roku - start retransmisji we storek (15.05) o godz. 16:00. \n\n\nSubskrybuj nasz kanał ➡ http://bit.ly/1w8ZNXX\n\nKręcioła.Tv łapcie nas tu:\nFacebook - https://www.facebook.com/kreciola\nInstagram - http://instagram.com/kreciolatv\nTwitter - https://twitter.com/kreciolatv\nSnapchat - @kreciolatv', '2018-05-30 00:35:55', '2018-05-30 00:35:55');
