(95, 5, 'The Hives - Go right ahead #Woodstock2016', 'https://www.youtube.com/embed/Sfvt9XSSDIY', 'https://i.ytimg.com/vi/Sfvt9XSSDIY/default.jpg', NULL, 'Dzisiaj słuchamy koncertu szwedzkiej, rockowej grupy The Hives! Ich występ okazał się wielką, pozytywną niespodzianką i przyciągnął tłumy. Z resztą ...', 'Dzisiaj słuchamy koncertu szwedzkiej, rockowej grupy The Hives! Ich występ okazał się wielką, pozytywną niespodzianką i przyciągnął tłumy. Z resztą zobaczcie sami! \n\nSubskrybuj nasz kanał ➡ http://bit.ly/1w8ZNXX\n\nKręcioła.Tv łapcie nas tu:\nFacebook - https://www.facebook.com/kreciola\nInstagram - http://instagram.com/kreciolatv\nTwitter - https://twitter.com/kreciolatv\nSnapchat - @kreciolatv', '2018-05-30 00:35:55', '2018-05-30 00:35:55'),
(96, 5, 'LemON - Myśl #Woodstock2017', 'https://www.youtube.com/embed/P6ZKEszCo1Q', 'https://i.ytimg.com/vi/P6ZKEszCo1Q/default.jpg', NULL, 'Na koncert LemOna czekało wiele osób, co widać po tłumnie zgromadzonej przed sceną publiczności. Jego występ wiele osób zapamięta na długo. Odpalajcie ...', 'Na koncert LemOna czekało wiele osób, co widać po tłumnie zgromadzonej przed sceną publiczności. Jego występ wiele osób zapamięta na długo. Odpalajcie i słuchajcie!\n\nSubskrybuj nasz kanał ➡ http://bit.ly/1w8ZNXX\n\nKręcioła.Tv łapcie nas tu:\nFacebook - https://www.facebook.com/kreciola\nInstagram - http://instagram.com/kreciolatv\nTwitter - https://twitter.com/kreciolatv\nSnapchat - @kreciolatv', '2018-05-30 00:35:56', '2018-05-30 00:35:56'),
(97, 5, 'Scena Nocna ASP - retransmisja koncertu Pawbeats Orchestra', 'https://www.youtube.com/embed/wfxwmEl7RPA', 'https://i.ytimg.com/vi/wfxwmEl7RPA/default.jpg', NULL, 'Pawbeats Orchestra to bardzo ciekawy projekt łączący rap, muzykę popularną oraz symfoniczną. Na jednej scenie wystąpiła m.in. orkiestra symfoniczna, ...', 'Pawbeats Orchestra to bardzo ciekawy projekt łączący rap, muzykę popularną oraz symfoniczną. Na jednej scenie wystąpiła m.in. orkiestra symfoniczna, wokaliści i raperzy. Co z tego wynikło? Przekonajcie się sami podczas naszej retransmisji - koncert w całości puścimy w czwartek (10.05) o godz. 18:00!\n\nKręcioła.Tv łapcie nas tu:\nFacebook - https://www.facebook.com/kreciola\nInstagram - http://instagram.com/kreciolatv\nTwitter - https://twitter.com/kreciolatv\nSnapchat - @kreciolatv', '2018-05-30 00:35:56', '2018-05-30 00:35:56'),
