(102, 5, 'Ludzie Mili - Poeci', 'https://www.youtube.com/embed/R6fgG4V7HvQ', 'https://i.ytimg.com/vi/R6fgG4V7HvQ/default.jpg', NULL, 'Ludzie Mili to tak naprawdę Indios Bravos w odsłonie bluesowej, wokalistą tutaj również jest Gutek, w tym przypadku wspomagany jednak dodatkowo przez ...', 'Ludzie Mili to tak naprawdę Indios Bravos w odsłonie bluesowej, wokalistą tutaj również jest Gutek, w tym przypadku wspomagany jednak dodatkowo przez damski i męski wokal. \n\nPosłuchajcie i przypomnijcie sobie ich występ podczas 18. Przystanku Woodstock!\n\nSubskrybuj nasz kanał ➡ http://bit.ly/1w8ZNXX\n\nKręcioła.Tv łapcie nas tu:\nFacebook - https://www.facebook.com/kreciola\nInstagram - http://instagram.com/kreciolatv\nTwitter - https://twitter.com/kreciolatv\nSnapchat - @kreciolatv', '2018-05-30 00:35:58', '2018-05-30 00:35:58'),
(103, 5, '#41 Kręciołowa Dziesiątka', 'https://www.youtube.com/embed/J_LfvSod83k', 'https://i.ytimg.com/vi/J_LfvSod83k/default.jpg', NULL, 'Wy proponujecie woodstockowe numery, a my puszczamy je na żywo - #41 Kręciołowa Dziesiątka: Dub Inc - Better run Habakuk - Rasta trans Lemon - Myśl ...', 'Wy proponujecie woodstockowe numery, a my puszczamy je na żywo - #41 Kręciołowa Dziesiątka:\nDub Inc - Better run\nHabakuk - Rasta trans\nLemon - Myśl\nLeningrad\nLudzie Mili - Poeci\nMy Riot - Ból przemija\nProjekt Grechuta - Gdzieś w nas\nRootwater - Hava Nagila\nKindred - Kill the power\nThe Hive - Go right ahead  \n\nKręcioła.Tv łapcie nas tu:\nFacebook - https://www.facebook.com/kreciola\nInstagram - http://instagram.com/kreciolatv\nTwitter - https://twitter.com/kreciolatv\nSnapchat - @kreciolatv', '2018-05-30 00:35:58', '2018-05-30 00:35:58'),
(104, 5, 'Retransmisja ASP - Agnieszka Holland #Woodstock2014', 'https://www.youtube.com/embed/U5aWvPypqXU', 'https://i.ytimg.com/vi/U5aWvPypqXU/default_live.jpg', NULL, 'Akademia Sztuk Przepięknych to miejsce bardzo ważnych spotkań i rozmów. Takim na pewno było to, które odbyło się w 2014 roku z światowej sławy reżyserką ...', 'Akademia Sztuk Przepięknych to miejsce bardzo ważnych spotkań i rozmów. Takim na pewno było to, które odbyło się w 2014 roku z światowej sławy reżyserką, pierwsza w historii kobietą prezydent Europejskiej Akademii Filmowej - Agnieszką Holland. Podczas prawie dwugodzinnej rozmowy poruszone zostało bardzo dużo kwestii dotyczących kina, świata filmu, ale również historii Polski.\n\nSubskrybuj nasz kanał ➡ http://bit.ly/1w8ZNXX\n\nKręcioła.Tv łapcie nas tu:\nFacebook - https://www.facebook.com/kreciola\nInstagram - http://instagram.com/kreciolatv\nTwitter - https://twitter.com/kreciolatv\nSnapchat - @kreciolatv', '2018-05-30 00:35:59', '2018-05-30 00:35:59'),
(105, 5, 'Jurek z prestiżową nagrodą Polonicus!', 'https://www.youtube.com/embed/lesJcEtPQ34', 'https://i.ytimg.com/vi/lesJcEtPQ34/default.jpg', NULL, '28 kwietnia w Akwizgranie z rąk europejskiej Polonii Jurek Owsiak otrzymał prestiżową nagrodę Polonicus za zaangażowanie w rozwój społeczeństwa ...', '28 kwietnia w Akwizgranie z rąk europejskiej Polonii Jurek Owsiak otrzymał prestiżową nagrodę Polonicus za zaangażowanie w rozwój społeczeństwa obywatelskiego. \n\nWśród laureatów znalazł sie również Donald Tusk - Przewodniczący Rady Europejskiej, oraz Benedykt i Róża Frąckiewiczowie, dyrygent i pierwsza solistka chóru Benedictus z Wuppertalu. \n\nZobaczcie naszą relecję z tego wydarzenia!', '2018-05-30 00:35:59', '2018-05-30 00:35:59'),
(106, 5, 'Retransmisja koncertu zespołu Shantel #Woodstock2012', 'https://www.youtube.com/embed/ZH7vBREj2Ps', 'https://i.ytimg.com/vi/ZH7vBREj2Ps/default.jpg', NULL, 'Shantel - muzyczny kosmopolita, międzykulturowy poszukiwacz i twórca międzygatunkowych brzmień, autor przeboju „Disko Partizani”. Artysta zagra wraz ze ...', 'Shantel - muzyczny kosmopolita, międzykulturowy poszukiwacz i twórca międzygatunkowych brzmień, autor przeboju „Disko Partizani”. Artysta zagra wraz ze swoją Bucovina Club Orkestar. Shantel to wyjątkowy twórca, który w ciągu kilku ostatnich lat stał się jednym z najlepszych towarów eksportowych Niemiec, nagradzany międzynarodowymi wyróżnieniami za swoje płyty, na których łączy tradycyjne bałkańskie brzmienia z klezmerskim feelingiem.\n\nPosłuchajcie tego koncertu w całości w czwartek (26.04) o godz. 18:00!\n\nSubskrybuj nasz kanał ➡ http://bit.ly/1w8ZNXX\n\nKręcioła.Tv łapcie nas tu:\nFacebook - https://www.facebook.com/kreciola\nInstagram - http://instagram.com/kreciolatv\nTwitter - https://twitter.com/kreciolatv\nSnapchat - @kreciolatv', '2018-05-30 00:36:00', '2018-05-30 00:36:00'),
(107, 5, '#40 Kręciołowa Dziesiątka', 'https://www.youtube.com/embed/DoO7Z4_ooXs', 'https://i.ytimg.com/vi/DoO7Z4_ooXs/default.jpg', NULL, 'Wy proponujecie woodstockowe numery, a my puszczamy je na żywo. Wpadajcie pogadać na czacie przy dobrej dawce woodstockowej muzy, którą sami ...', 'Wy proponujecie woodstockowe numery, a my puszczamy je na żywo. Wpadajcie pogadać na czacie przy dobrej dawce woodstockowej muzy, którą sami wybieracie!\n\n#40 Kręciołowa Dziesiątka:\nAcid Drinkers - Joker\nCounterfeit - Too old to live\nThe Dead Daisies - Long way to go\nKolory - Seventeen\nOddział Zamknięty - Ich marzenia\nOrange goblin - Made if rats\nProletariat - jak ptak\nThe Sixpounder - Fuel\nThe Bill - Kibel\nVoo Voo - Nim stanie się tak', '2018-05-30 00:36:00', '2018-05-30 00:36:00'),
(108, 5, '#44 Kręciołowa Dziesiątka', 'https://www.youtube.com/embed/bBg0QwDgwXw', 'https://i.ytimg.com/vi/bBg0QwDgwXw/default_live.jpg', NULL, 'Wy proponujecie woodstockowe numery, a my puszczamy je na żywo. Wpadajcie pogadać na czacie przy dobrej dawce woodstockowej muzy, którą sami ...', 'Wy proponujecie woodstockowe numery, a my puszczamy je na żywo. Wpadajcie pogadać na czacie przy dobrej dawce woodstockowej muzy, którą sami wybieracie!\n\nKręcioła.Tv łapcie nas tu:\nFacebook - https://www.facebook.com/kreciola\nInstagram - http://instagram.com/kreciolatv\nTwitter - https://twitter.com/kreciolatv\nSnapchat - @kreciolatv', '2018-05-30 00:36:00', '2018-05-30 00:36:00'),
(109, 5, 'Zobacz spotkanie z Kubą Wojewódzkim z #Woodstock2013', 'https://www.youtube.com/embed/VAzy2sqejCg', 'https://i.ytimg.com/vi/VAzy2sqejCg/default.jpg', NULL, 'Subskrybuj nasz kanał ➡ http://bit.ly/1w8ZNXX Tłumy jakie pojawiły się na spotkaniu z Kubą Wojewódzkim przerosły nasze najśmielsze oczekiwania.', 'Subskrybuj nasz kanał ➡ http://bit.ly/1w8ZNXX\n\nTłumy jakie pojawiły się na spotkaniu z Kubą Wojewódzkim przerosły nasze najśmielsze oczekiwania. Wiele osób stało przed namiotem oglądając wszystko na telebimie wystawionym obok Sceny Folkowej. Już na początku spotkania Kuba wzruszył się, kiedy cały namiot odśpiewał na jego cześć STO LAT - gość bowiem w dniu spotkania obchodził swoje 50 urodziny!\n\nPodczas rozmowy były momenty pełne śmiechu i żartów, ale zdarzały się również wyjątkowo poważne tematy. Posłuchajcie! \n\nKręcioła.Tv łapcie nas tu:\nFacebook - https://www.facebook.com/kreciola\nInstagram - http://instagram.com/kreciolatv\nTwitter - https://twitter.com/kreciolatv\nSnapchat - @kreciolatv', '2018-05-30 00:36:01', '2018-05-30 00:36:01'),
